%pyspark
from pyspark.sql.functions import udf
from pyspark.sql.functions import desc
from pyspark.sql.types import FloatType
from pyspark.sql.types import IntegerType
from pyspark.sql.types import DoubleType
from matplotlib import pyplot as plt
import seaborn as sns
import numpy as np
import pandas as pd

udf_dt2dh = udf(lambda d, t: d + ' ' + t.split(':')[0])
udf_dh2d = udf(lambda dh: dh.split(' ')[0])
udf_dh2h = udf(lambda dh: int(dh.split(' ')[1]), IntegerType())
udf_ymd2ym = udf(lambda ymd: ymd[:-3])
udf_date2month = udf(lambda d: d.split('-')[1])
udf_floatize = udf(lambda s: float(s), FloatType())
udf_joule = udf(lambda f: f*60, DoubleType())

def classifyPm10(pm):
    if pm <= 30:
        return 1

    elif 30 < pm <= 80:
        return 2
    elif 80 < pm <= 150:
        return 3
    else:
        return 4

def classifyPm25(pm):
    if pm <= 15:
        return 1
    elif 15 < pm <= 35:
        return 2
    elif 35 < pm <= 75:
        return 3
    else:
        return 4

def classifyPm10Accum(pm):
    return int(pm/200)

def classifyPm25Accum(pm):
    return int(pm/200)

def classifyWeather(date):
    month = int(date.split('-')[1])
    if 3 <= month <= 5:
        return 1
    elif 6 <= month <= 8:
        return 2
    elif 9 <= month <= 11:
        return 3
    else:
        return 4

udf_classifyPm10 = udf(classifyPm10, IntegerType())
udf_classifyPm25 = udf(classifyPm25, IntegerType())
udf_classifyPm10Accum = udf(classifyPm10Accum, IntegerType())
udf_classifyPm25Accum = udf(classifyPm25Accum, IntegerType())
udf_classifyWeather = udf(classifyWeather, IntegerType())
